import React, { Suspense } from "react";

import Box from './Box'


const Boxes = () => {
  return (
    <Suspense>
        <Box position={[0,0,2]} color={"blue"}/>
        <Box position={[2,0,2]} color={"green"}/>
        <Box position={[-2,0,2]} color={"red"}/>
    </Suspense>
  )
}

export default Boxes
